bool is_prime(int number) {
  if (number > 1 && number < 4) {
    return true;
  } else {
    if (number < 2 || number % 2 == 0 || number % 3 == 0) {
    return false;
  };
  }
  int i = 5;
  while (i * i <= number) {
    if (number % i == 0 || number % (i + 2) == 0) {
    return false;
  }
    i = i + 6;
  }
  return true;
}

int solution(int nth) {
  if (nth <= 0) {
    _error("Parameter nth must be greater than or equal to one.");
  }
  List<int> primes = <int>[];
  int _num = 2;
  while (primes.length < nth) {
    if (is_prime(_num)) {
    primes = [...primes, _num];
  }
    _num = _num + 1;
  }
  return primes[primes.length - 1];
}

